import React from "react";
import { Typography, Button, TextField } from "@material-ui/core";
import { withStyles } from "@material-ui/core/styles";

const Home = () => {

  const Title = withStyles({
    root: {
      color: "#7C3AED"
    }
  })(Typography);

  const LoginTextField = withStyles({
    root: {
      '& label.Mui-focused': {
        color: '#7C3AED',
      },
      '& .MuiOutlinedInput-root': {

        '& .MuiOutlinedInput-input':{
          color: 'white',
        },
        '& fieldset': {
          borderColor: '#9CA3AF',
        },
        '&:hover fieldset': {
          borderColor: 'white',
        },
        '&.Mui-focused fieldset': {
          borderColor: '#7C3AED',
        },

      },
      '& .MuiInputLabel-root': {
        color: 'white'
      }

    },
  })(TextField);

  const LoginButton = withStyles({
    root:{
      backgroundColor: '#7C3AED',
      color: 'white',
      width: '100 px',

      '&:hover':{
        backgroundColor:'#4C1D95'
      },
    },
  })(Button)


   return (
    <div class="h-full">
      <form class="h-full flex flex-wrap content-center justify-center flex-col" noValidate autoComplete="off">
        <div class="text-center">
          <Title variant="h2" colorPrimary="white">AutoSend</Title>
        </div>
        <div class="w-96 mt-5">
          <LoginTextField label="Email" variant="outlined" fullWidth="true"/>
        </div>
        <div class="w-96 mt-3">
          <LoginTextField label="Password" variant="outlined" fullWidth="true"/>
        </div>
        <div class="w-96 mt-3 text-right"> 
          <Link>

          <LoginButton variant="contained">Login</LoginButton>
          </Link>
        </div>


      </form>
    </div>
  );
};

export default Home;
